import "../../css/workList/workList.css";
import { WorkList } from "./WorkList";
export const WorkListTemplate = ({ targetTimeObj, cnt, user, date }) => {
  return (
    <div>
      <h1>Make Hamburger</h1>
      <WorkList
        user={user}
        date={date}
        cnt={cnt}
        targetTimeObj={targetTimeObj}
      />
    </div>
  );
};
